import {useEffect, useState} from "react";
import axios from "axios";

function App() {
  const [data, setData] = useState('');

  const apitest = async () => {
    try{
      axios.get('http://localhost:8080/api/test')
          .then((res) => {
            console.log("연동 완료")
            setData(res.data)
          });
    } catch (error){
      console.log("연동 오류: ", error)
    }
  }

  return (
      <div>
        <h2>API 테스트</h2>
        <button onClick={apitest}>test</button>
        {data ? data : ""}

      </div>
  );
}

export default App;
